-- GLOBALS
a = 0
flip = 0
camera = Vector2.new()
layers = {}
current_layer = 1 -- it's 1 index asshole ALSO THIS IS AN INT NOW OWOWWO

function TIC() -- main loop
	vbank(1) -- foreground mode
	
	cls()
	print(current_layer, 50,0, 2)
	Player:update()

	vbank(0) -- background mode
	cls()

	draw_layers()
end

function draw_layers()
	for depth = #layers - 1, current_layer, -1 do
		local layer = layers[depth]
		local ratio = (math.pow(2, -depth + current_layer + Player.layer_falling_timer / 32))

		vbank(1)
		print("ratio "..depth..": "..ratio, 50, 8 * depth, 2)
		vbank(0)

		draw_tiles(
			240 / 2 - Player.x * ratio + layer.offset.x * 16,
			136 / 2 - Player.y * ratio + layer.offset.y * 16,
			layer.from.x, layer.from.y,
			layer.size.x, layer.size.y,
			ratio
		)
	end
end

function draw_tiles(x, y, from_x_tiles, from_y_tiles, width_tiles, height_tiles, scale)
	local width, height = width_tiles * 32, height_tiles * 32
	local from_x, from_y = from_x_tiles * 32, from_y_tiles * 32
	
	local u1, v1 = from_x, from_y
	local u2, v2 = width + from_x, from_y
	local u3, v3 = from_x, height + from_y
	local u4, v4 = width + from_x, height + from_y

	local x1, y1 = x - width // 2 * scale, y - height // 2 * scale
	local x2, y2 = x + width // 2 * scale, y - height // 2 * scale
	local x3, y3 = x - width // 2 * scale, y + height // 2 * scale
	local x4, y4 = x + width // 2 * scale, y + height // 2 * scale

	ttri(x1, y1, x2, y2, x3, y3, u1, v1, u2, v2, u3, v3, 1, 0)
	ttri(x2, y2, x3, y3, x4, y4, u2, v2, u3, v3, u4, v4, 1, 0)
end

-- OBJECTS
Player = {
	x = 0, -- x coor
	y = 0, -- y coor
	h = 0, -- hor speed
	v = 0, -- ver speed
	state = "Idle",
	spr_index = 256,
	size = Vector2.new(24, 32),
	layer_falling_timer = 0 -- make this like 0 - 32 or something
}

function Player.update(self)
	if self.state == "Idle" then
		if btn(Button.A) then
			self.state = "Falling"
		end

		if btn(Button.Right) then
			self.h = 1
			self.v = 0
			self.spr_index = 262
			flip = 0
			a = 0
			self.state = "Moving"
		end

		if btn(Button.Left) then
			self.h = -1
			self.v = 0
			self.spr_index = 262
			flip = 1
			a = 0
			self.state = "Moving"
		end

		if btn(Button.Down) then
			self.h = 0
			self.v = 1
			self.spr_index = 256
			flip = 0
			a = 0
			self.state = "Moving"
		end

		if btn(Button.Up) then
			self.h = 0
			self.v = -1
			self.spr_index = 256
			flip = 0
			a = 0
			self.state = "Moving"
		end
	end

	if self.state == "Moving" then
		a = a + 2
		self.x = self.x + (2 * self.h)
		self.y = self.y + (2 * self.v)
		if a == 32 then
			a = 0
			self.state = "Idle"
		end
	end

	if self.state == "Falling" then
		self.layer_falling_timer = self.layer_falling_timer + 1
		if self.layer_falling_timer == 32 then
			current_layer = current_layer + 1
			self.layer_falling_timer = 0
			self.state = "Idle"
		end
	end

	-- render
	spr(self.spr_index                                   , 240/2 - self.size.x / 2, 136/2  - self.size.y / 2 - (math.sin(a/32*math.pi) * 15), 0, 1, flip, 0, 3, 2)
	spr(self.spr_index + 3 * (a > 0 and 1 or 0 ) + (16*2), 240/2 - self.size.x / 2, 136/2  - self.size.y / 2 - (math.sin(a/32*math.pi) * 15) + 16 , 0, 1, flip, 0, 3, 2)

end

